import React, { Component } from "react";

class App extends Component{
  render() {
    const tittle ="User App";
    const isAuthorized = true;

    return(
      <div className="container">
        <h5>{tittle}</h5>
        {
          isAuthorized ? <p>Authorized</p> : <p>Not</p>
        }
      </div>
    );
  }
}
export default App;
